Helen Fisher es una de las mayores expertas del mundo en el estudio científico del amor. Durante tres décadas, ha investigado el amor romántico y ha sometido a escáner a decenas de enamorados. Es autora de los exitosos libros 'Anatomía del amor' y 'Por qué amamos: naturaleza y química del amor romántico'. #Amor / #AprendemosJuntos

